body.script:
function share() {
	const shareData = {
		title: 'Murder, Mystery & Makeup - Podcast Details',
		text: 'All the public stats of the podcast Murder, Mystery & Makeup',
		url: 'https://podcastdetails.com/?url=https://audioboom.com/channels/5063197.rss',
	}
	// if(typeof screen.orientation === 'undefined' && window.navigator && window.navigator.share) {
	// 	navigator.share(shareData);
	// 	return;
	// }
	if (window.navigator && window.navigator.share && window.navigator.canShare(shareData) && window.navigator.canShare(shareData) && typeof screen.orientation === 'undefined') {
		navigator.share(shareData);
	} else {
		window.location.href = 'https://wocial.com/?create=1&url='+encodeURIComponent('https://podcastdetails.com/?url=https://audioboom.com/channels/5063197.rss')+'&text='+encodeURIComponent('Murder, Mystery & Makeup - Podcast Details')+'';
	}
}
